import { Stack } from '@mui/material';
import React from 'react';

const Pagination = () => {
  return (
    <Stack spacing={2}>
      <Pagination count={10} shape="rounded" />
      <Pagination count={10} variant="outlined" shape="rounded" />
    </Stack>
  )
}

export default Pagination
